import React from 'react';
import PropTypes from 'prop-types';
import Header from '../components/Header';
import getMusics from '../services/musicsAPI';

class Album extends React.Component {
  constructor() {
    super();

    this.state = {
      artists: [],
      id: '',
    };
  }

  async componentDidMount() {
    const {
      match: {
        params: { id },
      },
    } = this.props;

    const id2 = await getMusics(id);
    this.setState({ id: id2 });
  }

  render() {
    const { artists, id } = this.state;

    console.log(id);
    const response = getMusics(id);
    console.log(getMusics(id));
    this.setState({ artists: response });
    console.log(response);

    return (
      <div data-testid="page-album">
        <Header />
        <p data-testid="artist-name">{id}</p>
        <p data-testid="album-name">{artists}</p>
      </div>
    );
  }
}

Album.propTypes = {
  match: PropTypes.shape({
    params: PropTypes.shape({
      id: PropTypes.string,
    }),
  }).isRequired,
};

export default Album;
